import React from "react";
import {Container} from "react-bootstrap";
import "./copyright.css";

const Copyright = () => {
    return (
        <Container>
            <h4> &copy; 2019 || Nyleesia Nicome Schnarr.</h4>
            <br/>
        </Container>
    )
}

export default Copyright;
